import { Grid } from "@mui/material"
import { makeStyles } from "@mui/material"

const useStyles = makeStyles({
    title:{
        color: '#ffffff',
    }
})
const Apresentation = () =>{
    const classes = useStyles()
    return(
        <>
        <Grid container>
            <Grid item class={classes.title}>
               <h1>Willian<br />
               Jefferson
               </h1> 
            </Grid>
        </Grid>
        </>
    )
}

export default Apresentation
